properties.description:
Facile immobiliare propone in vendita in viale Stefini, zona Maggiolina (confinante con il noto quartiere Isola), luminoso bilocale appena ristrutturato in palazzina in fase di ristrutturazione, con bonus facciate già approvato (e già pagato).
Il termine dei lavori per il rifacimento esterno è dicembre 2022.L’immobile è così composto:
Ingresso su area living con cucina, tavolo da pranzo, divano, mobile TV e libreria con mensola. L'area living è dotata di finestra e porta finestra che consente l'accesso al balcone;
Superando l'area living si accede, tramite una porta scorrevole in corridoio, al bagno finestrato dotato di servizi, mobile su lavabo con specchio scorrevole e spaziosa doccia;
Proseguendo nel corridoio si accede alla zona notte, dove c'è una camera finestrata dotata di letto mat
